import React, { useState,useEffect } from "react";
import { useNavigate } from 'react-router-dom';

function Stock() {
 /* const [products, setProducts] = useState([
    { id: 1, name: "Ürün 1", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
    { id: 2, name: "Ürün 2", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
    { id: 3, name: "Ürün 3", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
    { id: 4, name: "Ürün 3", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
    { id: 5, name: "Ürün 3", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
    { id: 6, name: "Ürün 3", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
    { id: 7, name: "Ürün 3", image: "/images/orkide.png", stockCode: "000001", stockCount: 15 },
  ]);
  */

  const [productList, setProductList] = useState([]);

  const [productStock, setProductStock] = useState("");

  const handleIncreaseStock = (productId) => {
    const updatedProducts = productList.map((product) => {
      if (product.productId === productId) {
        return { ...product, stock: product.stock + 1 };
      }
      return product;
    });
    setProductList(updatedProducts);
  };

  const handleDecreaseStock = (productId) => {
    const updatedProducts = productList.map((product) => {
      if (product.productId === productId && product.stock > 0) {
        return { ...product, stock: product.stock - 1 };
      }
      return product;
    });
    setProductList(updatedProducts);
  };

  const navigate = useNavigate();

  const handleGoBack = () => {
    navigate(-1); // Bir önceki sayfaya yönlendirir
  };

  const handleStockUpdate = () => {
   // console.log("product",product);
    fetch("https://api.monjardin.online/api/Product/UpdateProduct", {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
     // body: JSON.stringify(product),
    })
      .then((response) => response.json())
      .then((data) => console.log(data))
      .catch((error) => console.error(error));
  };

  const fetchProductList = async () => {
    try {
      const response = await fetch(`https://api.monjardin.online/api/Product/GetAllProducts`);
      const data = await response.json();
      console.log("data",data.data)
      const productData= data.data;
      setProductList(productData);  
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    fetchProductList();
  }, []);


  const handleInputChange = (event, productId) => {
    const { value } = event.target;

    setProductList((prevList) =>
      prevList.map((product) =>
        product.productId === productId ? { ...product, stock: value } : product
      )
    );
  };

  return (
    <div style={{margin:"50px"}}>
  <h1  className='baslik'>Mon Jardin</h1>

<button onClick={handleGoBack} className='back-button'><img src="/images/back-button.png" alt="" width={40} height={30}/></button>
    <table className='table table-light'>
      <thead>
        <tr>
          <th></th>
          <th></th>
          <th></th>
          <th></th>
        </tr>
      </thead>
      <tbody>
        {productList.map((product) => (
          <tr key={product.productId}>
            <td style={{verticalAlign:"middle", width:"300px"}}>
             <img src={product.fileResponseModel[0]?.fileUrl} alt={productList.productName} width={128} height={128} />
            </td>
            <td style={{fontStyle:"italic", fontWeight:"bold", verticalAlign:"middle", width:"300px"}}>{product.productId}</td>

            <td style={{verticalAlign:"middle", width:"500px"}}>
              <button className="stock-button" onClick={() => handleDecreaseStock(product.productId)}>-</button>


              <input
              type="text"
              name="productStock"
              value={product.stock}
              onChange={handleInputChange}
              className="stock-count"
            />
             <input
    key={product.productId}
    type="text"
    name={`productStock_${product.productId}`}
    value={product.stock}
    onChange={(event) => handleInputChange(event, product.productId)}
    className="stock-count"
  />
              <button className="stock-button" onClick={() => handleIncreaseStock(product.productId)}>+</button>
            </td>
            <td style={{verticalAlign:"middle" , fontSize:"30px" , fontWeight:"bold", width:"300px"}}> 
            <img src="/images/check.png" alt="" width={30} height={30} onClick={handleStockUpdate}/> </td>
          </tr>
        ))}
      </tbody>
    </table>
    </div>
  );
}

export default Stock;
